import React, { useState, useEffect } from "react";

const Login = () => {
  return;
  <div>
    <form>
      <h2>Login</h2>
      <label htmlFor="email">
        Email:
        <input type="text" />
      </label>
      <label htmlFor="password">
        Password:
        <input type="password" />
      </label>
      <button>Login</button>
      <p>
        Already Registered? <a>Login</a>
      </p>
    </form>
  </div>;
};

export default Login;
